records.addlTxt:
Defendant Rodolfo Martinez in court with attorney Kelsey Morin.  Shawn N Woller appeared for the State of Wisconsin. 
Defendant entered a plea of guilty to counts 2 and 3.
Court conducted plea colloquy.
Court found defendant guilty.

The Defendant was sentenced to the following:

WITHHELD SENTENCE OF:     

TERM OF PROBATION:  18 MONTHS Counts 2 and 3 concurrent to each other and 15CM5; 15 days credit if revoked.

CONDITIONS OF PROBATION:  
*AODA Assessment and follow through with any treatment recommended;
*Absolute Sobriety;  
*No Use or Possession of alcohol, controlled substances or drug paraphernalia.
*No Use or Possession of prescription drugs without a valid prescription;
*Any valid prescription drugs must be taken only in the manner in which they are prescribed.
*Inform Agent of all prescriptions and sign a medical release;
*Follow through with any treatment and/or counseling recommended by Agent;
*No contact with:  victim (defendant's son) or his residence unless the victim and residents at the resident consent is given and agent agrees to contact;
*Defendant not to operate a motor vehicle without a valid license;
*Defendant to obtain a driver license within the first 9 months.
*Complete an anger management program.

COURT COSTS:  $243.00 each count (counts 2 and 3) to be paid at a rate of $75.00 per month commencing August 1, 2015 as a condition of probation; alternate 4 days jail. Defendant may use community service in lieu of fine at $10.00 equals 1 hour. Defendant may go to W.C.S. for information on community service. 

CONDITION TIME: 20 days, STAYED; with Huber to be used at agent's discretion.  

Probation may be transferred to Racine County. 

Cash Bail to be refunded to poster.
